import React from 'react';

import styles from './TileItem.module.css';


export default ({ index, text, handleClick }) => {
	return (
  	<li className={styles.row} onClick={() => handleClick(index)}>
			<div className={styles.text}>
				{text}
			</div>
		</li>
	);
};
